import styled from "styled-components";

export const WeekForecast = styled.section`
display: grid;
place-items: center;
`;

export const SmallContainer = styled.section`
display: grid;
place-items: center;
grid-template-columns: repeat(2, 1fr);
grid-template-rows: repeat(2, 1fr);
gap: 0;
`
